import React from 'react';
import Card from './Card'
import AddExercise from './AddExercise';

const ExerciseList = ({exercises}) => (
    
    <div className="center">
        {
            exercises.map((excercise) => {
                return(
                    <Card
                        key={excercise._id}
                        id={excercise._id}
                        {...excercise}
                    />
                )
            })
        }
        <AddExercise />
    </div>
)
export default ExerciseList
